#include <vector>
#include <iostream>
#include <queue>

bool is_minimum(const int row, const int col, const std::vector<std::vector<int64_t>> &map)
{
    int64_t val = map.at(row).at(col);
    if (val < 0 || val >= 9)
    {
        return false;
    }
    if (row > 0 && val >= map.at(row - 1).at(col))
    {
        return false;
    }
    if (row < 99 && val >= map.at(row + 1).at(col))
    {
        return false;
    }
    if (col > 0 && val >= map.at(row).at(col - 1))
    {
        return false;
    }
    if (col < 99 && val >= map.at(row).at(col + 1))
    {
        return false;
    }
    return true;
}

bool valid_location(int64_t row, int64_t col)
{
    return (row <= 99 && row >= 0 && col <= 99 && col >= 0);
}

void add_neighbors(int64_t row, int64_t col, std::queue<std::pair<int64_t, int64_t>> &next, std::vector<std::vector<int64_t>> &map)
{
    if (valid_location(row + 1, col) && map.at(row + 1).at(col) != -1 && map.at(row + 1).at(col) != 9 && map.at(row + 1).at(col) != -2)
    {
        next.emplace(row + 1, col);
        map.at(row + 1).at(col) = -1;
    }
    if (valid_location(row - 1, col) && map.at(row - 1).at(col) != -1 && map.at(row - 1).at(col) != 9 && map.at(row - 1).at(col) != -2)
    {
        next.emplace(row - 1, col);
        map.at(row - 1).at(col) = -1;
    }
    if (valid_location(row, col - 1) && map.at(row).at(col - 1) != -1 && map.at(row).at(col - 1) != 9 && map.at(row).at(col - 1) != -2)
    {
        next.emplace(row, col - 1);
        map.at(row).at(col - 1) = -1;
    }
    if (valid_location(row, col + 1) && map.at(row).at(col + 1) != -1 && map.at(row).at(col + 1) != 9 && map.at(row).at(col + 1) != -2)
    {
        next.emplace(row, col + 1);
        map.at(row).at(col + 1) = -1;
    }
}

int64_t bfs_get_size(int64_t row, int64_t col, std::vector<std::vector<int64_t>> &map)
{
    map.at(row).at(col) = -1;
    int64_t basin_size = 1;
    std::queue<std::pair<int64_t, int64_t>> next;
    add_neighbors(row, col, next, map);
    while (!next.empty())
    {
        auto coords = next.front();
        next.pop();
        add_neighbors(coords.first, coords.second, next, map);
        map.at(coords.first).at(coords.second) = -2;
        basin_size += 1;
    }
    return basin_size;
}

